drop table category_game cascade constraints;
drop table category_mov_book cascade constraints;
drop table users cascade constraints;
drop table review cascade constraints;
drop table game cascade constraints;
drop table movie cascade constraints;
drop table book cascade constraints;
drop table developer cascade constraints;
drop table author cascade constraints;
commit;

create table category_game (
    cat_id integer not null,
    name varchar(200) not null,
    primary key (cat_id)
);
create table category_mov_book (
    cat_id integer not null,
    name varchar(200) not null,
    primary key (cat_id)
);
create table users (
user_id integer not null,
name varchar(200) not null,
password varchar(200) not null,
email varchar(200) not null,
primary key (user_id)
);
create table author (
    author_id integer not null,
    name varchar(1000) not null,
    primary key(author_id)
);
create table developer (
    dev_id integer not null,
    name varchar(200) not null,
    primary key(dev_id)
);
create table game (
    game_id integer not null,
    price float not null,
    name varchar(500) not null,
    installs varchar(500) not null,
    cat_id integer not null,
    dev_id integer not null,
    rating integer not null,
    primary key (game_id),
    foreign key (cat_id) references category_game(cat_id),
    foreign key (dev_id) references developer(dev_id)
);
create table movie (
    movie_id integer not null,
    picture varchar(2000) not null,
    name varchar(1000) not null,
    imdb varchar(2000) not null,
    cat_id integer not null,
    rating integer not null,
    primary key (movie_id),
    foreign key (cat_id) references category_mov_book(cat_id)

);
create table book (
    book_id integer not null,
    name varchar(2000) not null,
    pub_date varchar(2000) not null,
    num_of_pages integer not null,
    isbn varchar(20) not null,
    cat_id integer not null,
    author_id integer not null,
    rating integer not null,
    primary key(book_id),
    foreign key (cat_id) references category_mov_book(cat_id),
    foreign key(author_id) references author(author_id)
);
create table review (
user_id integer not null,
game_id integer null,
book_id integer null,
movie_id integer null,
review_id integer not null,
comment_txt varchar(2000) not null,
comment_date date not null,
rating integer not null,
primary key (review_id),
foreign key (user_id) references users(user_id),
foreign key (book_id) references book(book_id),
foreign key (game_id) references game(game_id),
foreign key (movie_id) references movie(movie_id)
);
commit;
